    x = linspace(0, 1, N+1);
    x = (L - hmin*N)*x.^n;
    h = hmin + diff(x);

function dpdx = dY(h1, h2, Y0, Y1, Y2)
    a2 = (h1 + 2*h2)/(3*h2*(h1 + h2));
    a1 = (h2 - h1)/(3*h1*h2);
    a0 = -(2*h1 + h2)/(3*h1*(h1 + h2));
    dpdx = a2 * Y2 + a1 * Y1 + a0 * Y0;

function ddpdx = ddY(h1, h2, Y0, Y1, Y2)
    a2 = 2/(h2 * (h1 + h2));
    a1 = -2/(h1 * h2);
    a0 = 2/(h1 * (h1 + h2));
    ddpdx = a2 * Y2 + a1 * Y1 + a0 * Y0;

function dpdx = leftdY(h1, h2, Y0, Y1, Y2)
    a2 = -h1 / (h2 * (h1 + h2));
    a1 = (h1 + h2) / (h1 * h2);
    a0 = -(2*h1 + h2) / (h1 * (h1 + h2));
    dpdx = a2 * Y2 + a1 * Y1 + a0 * Y0;

